import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav className="p-4 bg-gray-800 text-white">
            <Link to="/" className="mr-4">Products</Link>
            <Link to="/cart">Cart</Link>
        </nav>
    );
}

export default Navbar;
